" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of prerenal pediatric acute kidney injury",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Mechanism",
"       </td>",
"       <td class=\"subtitle1\">",
"        Etiology",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased intravascular volume",
"       </td>",
"       <td>",
"        Dehydration, hemorrhage, diuretics, burns, shock, nephrotic syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Decreased cardiac function",
"       </td>",
"       <td>",
"        Heart failure, arrhythmias",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Peripheral vasodilatation",
"       </td>",
"       <td>",
"        Sepsis, anaphylaxis, antihypertensive medication",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Renal vasoconstriction",
"       </td>",
"       <td>",
"        Sepsis, nonsteroidal antiinflammatory drugs, ACE inhibitor",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <p>",
"     &nbsp;",
"    </p>",
"    <div class=\"footnotes\">",
"     ACE: angiotensin converting enzyme.",
"    </div>",
