var title_f4_1_4124="Chronologic appearance and characteristics of organisms in burns";
var content_f4_1_4124=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F83410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F83410&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Chronologic appearance and characteristics of organisms in burns",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Organism, chronology",
"       </td>",
"       <td class=\"subtitle1\">",
"        Characteristics",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Commensal skin organisms (gram positive) result in early colonization of burns",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Streptococcus and Staphylococcus species primarily",
"         </li>",
"         <li>",
"          Other sources are upper respiratory tract and environment",
"         </li>",
"         <li>",
"          Topical antimicrobials help decrease colonization",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Gram-negative species dominant &gt;5 days",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          2 to 4 days post-burn, gram-negative bacteria colonize wound",
"         </li>",
"         <li>",
"          Patient skin, upper respiratory tract, gastrointestinal tract, and hospital environment are typical sources",
"         </li>",
"         <li>",
"          Pseudomonas aeruginoasa, Acinetobacter baumannii, E. Coli, Klebsiella pneumoniae, Enterobacter cloacae.",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        If gram-negative cover is initiated, yeast often appears",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          Yeast and fungi colonization follows",
"         </li>",
"         <li>",
"          Majority are Candida&nbsp;species, other fungi are increasing in frequency",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Finally, more resistant bacteria and fungi invade the wound",
"       </td>",
"       <td>",
"        <ul>",
"         <li>",
"          MRSA, VRE, multi-drug-resistant Pseudomonas and Acinetobacter species, and fungi",
"         </li>",
"         <li>",
"          Usually secondary to broad-spectrum antibiotics, or inadequate host response or therapeutic measures (excision burn, topical and systemic antibiotics)",
"         </li>",
"         <li>",
"          Transition from colonization to invasion",
"         </li>",
"        </ul>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     MRSA:&nbsp; methicillin-resistant Staphylococcus aureus, VRE: vancomycin-resistant Enterococcus",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
